DROP SCHEMA `multitask` ;
CREATE SCHEMA `multitask` ;
USE `multitask`;

CREATE TABLE `applications_history` (
`_id` INTEGER NOT NULL,
`timestamp` FLOAT,
`device_id` VARCHAR(50),
`package_name` VARCHAR(50),
`application_name` VARCHAR(50),
`process_importance` INTEGER,
`process_id` INTEGER,
`double_end_timestamp` FLOAT,
`is_system_app` INTEGER,
primary key (_id));



SELECT from_unixtime(ah.timestamp/1000), from_unixtime(ah.double_end_timestamp/1000), timestampdiff(second, from_unixtime(ah.timestamp/1000), from_unixtime(ah.double_end_timestamp/1000))
FROM applications_history ah
